import React, { useState } from "react";
import { Navbar, NavbarBrand } from "reactstrap";

function NavBar(args) {
  return (
    <div>
      <Navbar {...args} color="success">
        <NavbarBrand href="/">reactstrap</NavbarBrand>
      </Navbar>
    </div>
  );
}

export default NavBar;
